export default new Response(
	new ReadableStream({
		start(controller) {
			controller.enqueue(Uint8Array.from(atob(""), (A) => A.charCodeAt(0)));
			controller.close();
		},
	}).pipeThrough(new DecompressionStream("gzip")),
	{
		headers: {
			"content-type": "application/wasm",
		},
	},
);